import React from "react";
import Snackbar from "@material-ui/core/Snackbar";

export default function TransitionsSnackbar() {
  return (
    <Snackbar
      open={state.open}
      onClose={handleClose}
      TransitionComponent={state.Transition}
      message="I love snacks"
    />
  );
}
